import React from "react";
import styles from "./MealForm.module.css";
import Input from "../UI/Input";

const MealForm = (props) => {
  return (
    <div className={styles.form}>
      <Input
        label="Amount"
        input={{
          id: "amount",
          type: "number",
          min: "1",
          max: "10",
          step: "2",
          defaultValue: "1",
        }}
      />
      <button>+Add to Cart</button>
    </div>
  );
};

export default MealForm;
